import { getImageUrl } from "./utils";
export default function Avatar({ person, size }) {
  console.log({ person });
  return (
    <img
      className="avatar"
      src={getImageUrl({ person })}
      alt={person.name}
      width={size}
      height={size}
    />
  );
}
